import React from 'react';
import MoviePoster from '../MoviePosters/MovePoster/MoviePoster';
import MoviePosters from '../MoviePosters/MoviePosters';
import classes from './Layout.module.css'
import { black, white } from 'ansi-colors';

const style = {
    backgroundColor: black,
    padding: '20px',
    color: white
};
const layout = props => (

    <div>
        <div style={{style}}>Toolbar</div>
        <MoviePosters movies={['Movie1', 'Movie2', 'Movie3','Movie4', 'Movie5', 'Movie6']}/>
    </div>
);

export default layout;
